import React from "react";
import Logo from "../../assets/logo.svg";
import { Link } from "react-router-dom";

function Header() {
  return (
    <header className="header">
      <Link to="/">
        <img className="logo" src={Logo} alt="logo" />
      </Link>

    </header>
  );
}

export default Header;
